import React from 'react'
import { Chart } from 'primereact/chart'
export default function trader({pair,data,store}:{pair:string, data:any ,store:IState}){
    const lastPrices = store.ticks.map((tick:ITick)=>{
        return tick[pair].c[0]
    })
    const basicData = {
        labels: ['January', 'February', 'March', 'April', 'May', 'June', 'July'],
        datasets: [
            {
                label: 'price',
                data:lastPrices,
                fill: false,
                borderColor: '#42A5F5'
            },

        ]
    }
    return <>
   <Chart   type="line" data={basicData} style={{height:200}} options={{responsive:true,  maintainAspectRatio: false}} />

    </>
}
